import React, { lazy, Suspense } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Header from './components/Header';
import Footer from './components/Footer';
import FloatingEnquiryBtn from './components/FloatingEnquiryBtn';
import ScrollToTop from './components/ScrollToTop';
import './App.css';

// Lazy load pages for code splitting
const Home = lazy(() => import('./pages/Home'));
const About = lazy(() => import('./pages/About'));
const Services = lazy(() => import('./pages/Services'));
const ServiceDetail = lazy(() => import('./pages/ServiceDetail'));
const OfficeHousekeeping = lazy(() => import('./pages/OfficeHousekeeping'));
const HotelHousekeeping = lazy(() => import('./pages/HotelHousekeeping'));
const HospitalHousekeeping = lazy(() => import('./pages/HospitalHousekeeping'));
const SalonHousekeeping = lazy(() => import('./pages/SalonHousekeeping'));
const BankHousekeeping = lazy(() => import('./pages/BankHousekeeping'));
const BankHousekeepingJabalpur = lazy(() => import('./pages/BankHousekeepingJabalpur'));
